style.css:
{"result":"@-moz-document regexp("^https?:\/\/leosight\.cz(.*)$") {
body, a {
  color: #FFF !important;
}

img[alt="LeoSight.cz"] {
  content: url(https://i.imgur.com/nLCjLgr.png);
}

.userpanel, .panel-primary, .status-head {
  background: #111 !important;
}

.fa, .server-panel {
  color: #000 !important;
}

.status {
  background: #252525 !important;
}

.menu a {
  color: #FFF !important;
  background: #252525 !important;
}

.panel-primary>.panel-heading {
  background: #252525 !important;
  border-bottom: 1px solid #111 !important;
}

.panel-default>.panel-heading {
  background-image: linear-gradient(to bottom,#222222 0,#111111 100%) !important;
  color: #FFF !important;
}

.panel-footer, .content {
  background: #222 !important;
}

.menu a:hover, .btn-donate, .breadcrumb, .well, .panel-body, .lista, td.text-right, td.text-left {
  background: #333 !important;
}

.ddown-content a {
  background: #000 !important;
  border-top: 1px solid #333 !important;
  color: #333 !important;
}

.ddown-content a:hover {
  color: #FFF !important;
  background: #333 !important;
}

.ddown-content hr {
  color: #000 !important;
  background: #000 !important;
  border-color: #000 !important;
}

.ddown .ddown-button, .menu {
  color: #FFF !important;
  background: #252525 !important;
}

.menu a:hover, .ddown:hover .ddown-button{
  color: #FFF;
  background: #333 !important;
}

.up-button:hover, .btn-donate:hover, .lista .progress, .tag, .article {
  background: #000 !important;
}

.up-button {
  background: #333 !important;
  border-top: 1px solid #000 !important;
}

.achead {
  background: #333 !important;
  border-top: 3px solid #000 !important;
}

.donation-bar > div {
  background-color: #333 !important;
}

.donate-box {
  background: #111 !important;
  border: 15px solid #111 !important;
}

#kategorie, #prodavajici {
  color: #000 !important;
  background: #555 !important;
}

.chosen-single, .chosen-search-input {
  color: #000 !important;
}

input, .rb-attacker, .rb-defender {
  color: #000 !important;
}


.table>tbody>tr.info>td, .table>tbody>tr.success>td {
  background: #555 !important;
}

.servers {
  border-bottom: 2px solid #333 !important;
}

a.btn.btn-default {
  background: #000 !important;
}

a.btn.btn-default.active {
  background: #333 !important;
}

a.btn.btn-default:hover, a.btn.btn-default.active:hover {
  background: #444 !important;
}

.inner {
  background: #222 !important;
  border-bottom: 5px solid #333 !important;
}

footer a {
  color: #333 !important;
}

footer {
  color: #FFF !important;
}


}
"}
